  constructor() {
    const today = new Date();
    const formattedDate = today.toISOString().split('T')[0]; // Formato "yyyy-MM-dd"
        // Asignamos la fecha actual a las variables
        this.startDate = formattedDate;
        this.endDate = formattedDate;
  }

  ngOnInit(): void {
    this.showFilters=false;
  }
  ngAfterViewInit(): void {
    this.dataSource.paginator = this.paginator; // Vincula el paginador a la tabla
    this.dataSource.data.length = 0; // Asignar la longitud de los datos a la tabla  
}
Filter():void{
    this.showFilters=!this.showFilters;

}
onSearch(): void {
    if (!this.data || this.data.length === 0) {
      console.warn('No hay datos disponibles para filtrar.');
      return;
    }
  
    const start = this.startDate ? new Date(this.startDate) : null;
    const end = this.endDate ? new Date(this.endDate) : null;
  
    // Filtrar los datos seg√∫n los filtros activos
    const filteredData = this.data.filter(item => {
      const itemStartDate = new Date(item.segstart);
  
      // Filtrar por rango de fechas
      const matchesDate =
        (!start || itemStartDate >= start) && (!end || itemStartDate <= end);
  
      // Si no se muestran filtros adicionales, solo validar las fechas
      if (!this.showFilters) {
        return matchesDate;
      }
  
      // Filtrar por origen, destino y tipo
      const matchesOrigin = this.origin ? item.callingparty.includes(this.origin) : true;
      const matchesDestination = this.destination ? item.dialednumber.includes(this.destination) : true;
      const matchesType = this.type ? item.tipo === this.type : true;
  
      // Retornar verdadero si todas las condiciones se cumplen
      return matchesDate && matchesOrigin && matchesDestination && matchesType;
    });
  
    // Actualizar los datos de la tabla
    this.dataSource.data = filteredData;
  }
  
